var Profile={read:function(b){if(!b.hasOwnProperty("head")){return}for(var a in b){if(b.hasOwnProperty(a)&&a!=="head"){Profile.Field.generic(a,b[a])}}},reload:function(){if(Pages.current!=1){return}Profile.read(SimpleChat.feed(Settings.id,"profile"))},Field:{generic:function(c,b){if(typeof b!=="string"){return}if(b===""){return}var a="<tr><td>"+c+"</td><td>"+b+"</td></tr>";$("#profile-table > tbody").append(a)}}};Pages.onInfo.push(Profile.reload);ChatView.reload.connect(Profile.reload);